const e=JSON.parse('{"key":"v-e49dc7a6","path":"/framework/1mybatis.html","title":"MyBatis","lang":"zh-CN","frontmatter":{"title":"MyBatis","icon":"shujuku","category":["框架"],"tag":["MyBatis","八股"]},"headers":[{"level":3,"title":"#{} 和 ${} 的区别是什么？","slug":"和-的区别是什么","link":"#和-的区别是什么","children":[]},{"level":3,"title":"Dao 接口的工作原理是什么？Dao 接口里的方法，参数不同时，方法能重载吗？","slug":"dao-接口的工作原理是什么-dao-接口里的方法-参数不同时-方法能重载吗","link":"#dao-接口的工作原理是什么-dao-接口里的方法-参数不同时-方法能重载吗","children":[]},{"level":3,"title":"MyBatis的xml映射文件中，不同的xml映射文件，id是否可以重复？","slug":"mybatis的xml映射文件中-不同的xml映射文件-id是否可以重复","link":"#mybatis的xml映射文件中-不同的xml映射文件-id是否可以重复","children":[]},{"level":3,"title":"MyBatis的xml映射文件和MyBatis内部数据结构的映射关系？","slug":"mybatis的xml映射文件和mybatis内部数据结构的映射关系","link":"#mybatis的xml映射文件和mybatis内部数据结构的映射关系","children":[]},{"level":3,"title":"属性名和字段名不一致如何解决？","slug":"属性名和字段名不一致如何解决","link":"#属性名和字段名不一致如何解决","children":[]},{"level":3,"title":"MyBatis中的分页","slug":"mybatis中的分页","link":"#mybatis中的分页","children":[]},{"level":3,"title":"MyBatis中的执行器有哪些？","slug":"mybatis中的执行器有哪些","link":"#mybatis中的执行器有哪些","children":[]}],"git":{"createdTime":1690615316000,"updatedTime":1690615316000,"contributors":[{"name":"ZYL1210","email":"870138612@qq.com","commits":1}]},"readingTime":{"minutes":3.83,"words":1148},"filePathRelative":"framework/1mybatis.md","localizedDate":"2023年7月29日","excerpt":"<h3> #{} 和 ${} 的区别是什么？</h3>\\n<ul>\\n<li>\\n<p><code>${}</code>是 Properties 文件中的变量占位符，它可以用于标签属性值和 sql 内部，<strong>属于静态文本替换</strong>，比如${driver}会被静态替换为<code>com.mysql.jdbc. Driver</code>。</p>\\n</li>\\n<li>\\n<p><code>#{}</code>是 <strong>sql 的参数占位符</strong>，MyBatis 会将 sql 中的<code>#{}</code>替换为? 号，在 sql 执行前会使用 PreparedStatement 的参数设置方法，按序给 sql 的? 号占位符设置参数值，比如 ps.setInt(0, parameterValue)，<code>#{item.name}</code> 的取值方式为使用反射从参数对象中获取 item 对象的 name 属性值，相当于 <code>param.getItem().getName()</code>。可以有效防止sql注入问题。</p>\\n</li>\\n</ul>"}');export{e as data};
